window.bookSummaryJSON = "<p>Edward Fasbender is a devil.&nbsp;</p> <p>He’s my father's biggest rival. He takes what he wants, and he bows to no one.&nbsp;</p> <p>And now Edward Fasbender wants me.&nbsp;</p> <p>I didn’t expect to want him back.&nbsp;</p> <p>Having him is not in the cards, not when a union with him would destroy my father. But that doesn’t mean I can’t play with him a bit.&nbsp;</p> <p>Except, I’ve never played against such a ruthless opponent. Edward is cold and vicious, and my blood has never run hotter. They say you should choose the devil you know, but I've always preferred long odds.&nbsp;</p> <p>Even if it'll get me slain.</p>"; 
